//layout
import LayoutAdmin from "../Layouts/LayoutsAdmin";
import Admin from "../pages/Admin";

//Admin Pages
import AdminHome from "../pages/Admin";
import AdminSingnIn from "../pages/Admin/SingnIn"

const routes = [
    {
        patch: "/admin",
        component: LayoutAdmin,
        exact: false,
        routes:[
            {
                
                patch:"/admin",
                component: AdminHome,
                exact: true
                
                
            }
            
        ],

        patch: "/admin/login",
        component: AdminSingnIn,
        exact: false,
        routes:[
            {
                
                patch:"/admin",
                component: AdminSingnIn,
                exact: true
                
                
            }
            
        ]
    }
];

export default routes;
